import { FC, useState } from "react";
import {
  FaChevronDown,
  FaChevronUp,
  FaPlusSpace,
} from "../../../../icons/icons";
import { useAppSelector } from "../../../../../redux/hooks";
import { RootState } from "../../../../../redux/store";

export const MyFirstSpaceOption: FC = () => {
  const projects = useAppSelector(
    (state: RootState) => state.project.projects
  );
  const [isOpen, setIsOpen] = useState<boolean>(false);
  return (
    <div>
      <button
        onClick={() => setIsOpen(!isOpen)}
        className="flex items-center w-full px-4 pt-4"
      >
        <div>{isOpen ? <FaChevronUp /> : <FaChevronDown />}</div>
        <div className="flex items-center">
          <span className="pl-2 text-base font-normal">My first space</span>
        </div>
      </button>
      {isOpen && (
        <div className="">
          <button className="flex items-center pl-10 pt-4">
            <FaPlusSpace />
            <span className="pl-2 text-primary-500 font-medium text-sm">
              Create project
            </span>
          </button>
        </div>
      )}
    </div>
  );
};
